package com.axallant.rentcloud.payment;

public class YearData {

	private double totalRentYear;
	private double collectedRentYear;
	private double pendingRentYear;
	private int year;
	
	public YearData() {
		// TODO Auto-generated constructor stub
	}
	
	public double getTotalRentYear() {
		return totalRentYear;
	}
	public void setTotalRentYear(double totalRentYear) {
		this.totalRentYear = totalRentYear;
	}
	public double getCollectedRentYear() {
		return collectedRentYear;
	}
	public void setCollectedRentYear(double collectedRentYear) {
		this.collectedRentYear = collectedRentYear;
	}
	public double getPendingRentYear() {
		return pendingRentYear;
	}
	public void setPendingRentYear(double pendingRentYear) {
		this.pendingRentYear = pendingRentYear;
	}
	public int getYear() {
		return year;
	}
	public void setYear(int year) {
		this.year = year;
	}
	
	
	
}
